My Friends Hot Mom - Diamond Jackson 

Actors: Diamond Jackson, Michael Vegas

Release Date: January 27, 2011

Diamond has let her son's college buddy Michael sleep in today because the night before she overheard him arguing with someone long into the night. She comes into his room with some fresh baked muffins and has a chat with him. It's not like Michael to sleep late, he is the industrious, out-going guy that she has known since he was a kid. He is definitely down in the dumps, and the muffins aren't doing the trick. Time to up the ante. Diamond is going to do what she has wanted to do with Michael since he graduated college.....suck and fuck his brains out!
